import './App.css';
import EventDemoComponent from './components/EventsDemoComponent';
import Hello from "./Hello";
import StateDemoComponent from './StateDemoComponent';

function App() {

  return (
    <div className="App">
      <h2>Hello React</h2>
      <Hello name="Venus" lastname="Velazquez"/>
      <hr/>
      <EventDemoComponent/>
      <hr/>
      <StateDemoComponent/>
    </div>
  );
}

export default App;
